 first email I sent to each supervisor that had the CLEAR DIRECTION to have all of this shipped off by \\u003cb\\u003e\\u003cspan style\\u003d\\\"color:red\\\"\\u003eFriday 12.8.2023\\u003c/span\\u003e\\u003c/b\\u003e\\u003cspan style\\u003d\\\"color:red\\\"\\u003e \\u003c/span\\u003eas requested below. \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eI wanted to send a RECAP of all the labels I sent as we don’t have them for all stores, and we have some stores that had 2 emails sent.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eSo I wanted to kindly ask that you cross reference the list below to ensure that the Supervisors and Store Managers have all the necessary documents so they can start gathering all their equipment that has been stored on top of walk-in coolers for close to a year in some of these store’s cases. \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cb\\u003eSheila \\u003cspan style\\u003d\\\"background:lime\\\"\\u003e7 TOTAL \\u003c/span\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/b\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e1355\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e1387\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e1510\\u003cu\\u003e\\u003c/ 03d\\\"font-size:12.0pt\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cspan style\\u003d\\\"font-size:12.0pt\\\"\\u003eFor the sake of efficiently doing this project, Sarah had asked me to lead this project since she has done this before. This process can be cumbersome and Sarah can help eliminate some of the pinch points. \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cspan style\\u003d\\\"font-size:12.0pt\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cspan style\\u003d\\\"font-size:12.0pt\\\"\\u003eSarah, can you please take the lead with this as you requested?\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cspan style\\u003d\\\"font-size:12.0pt\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/span\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eThank you\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eSujit Pal\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eVice President, Administration\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eBajco Global Management\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003ePhone: (330) 533-0900\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eFax: (330) 533-6993\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003c/div\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cu\\u003e\\u003c/u\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eOn Fri, Dec 1, 2023 at 1:18 PM \\u0026lt;\\u003ca href\\u003d\\\"mailto:cpate@bajco.net\\\" target\\u003d\\\"_blank\\\"\\u003ecpate@bajco.net\\u003c/a\\u003e\\u0026gt; wrote:\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003c/div\\u003e\\u003cblockquote style\\u003d\\\"border:none;border-left:solid #cccccc 1.0pt;padding:0in 0in 0in 6.0pt;margin-left:4.8pt;margin-right:0in\\\"\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cdiv\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eGood morning Sujit,\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eI have sent all the shipping labels to the Supervisors and Store Managers. I Cc everyone here on the first email I sent to each supervisor that had the CLEAR DIRECTION to have all of this shipped off by \\u003cb\\u003e\\u003cspan style\\u003d\\\"color:red\\\"\\u003eFriday 12.8.2023\\u003c/span\\u003e\\u003c/b\\u003e\\u003cspan style\\u003d\\\"color:red\\\"\\u003e \\u003c/span\\u003eas requested below. \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eI wanted to send a RECAP of all the labels I sent as we don’t have them for all stores, and we have some stores that had 2 emails sent.\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003eSo I wanted to kindly ask that you cross reference the list below to ensure that the Supervisors and Store Managers have all the necessary documents so they can start gathering all their equipment that has been stored on top of walk-in coolers for close to a year in some of these store’s cases. \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e \\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e\\u003cb\\u003eSheila \\u003cspan style\\u003d\\\"color:black;background:lime\\\"\\u003e7 TOTAL \\u003c/span\\u003e\\u003c/b\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e1355\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e1387\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\\\"\\u003e1510\\u003cu\\u003e\\u003c/u\\u003e\\u003cu\\u003e\\u003c/u\\u003e\\u003c/p\\u003e\\u003cp class\\u003d\\\"MsoNormal\
